In Japan, discipline and strict hygiene measures have allowed public life to continue without too much interruption, even in densely populated Tokyo. And in China, where the coronavirus pandemic started, quarantines, lock-down and strict surveillance have contributed to slowing spread. Whether or not these methods prove sustainable in the long run remains to be seen. But they are sending a message of hope that there may be ways out of the coronavirus crisis.\\n\\n-------------------------------------------------------------------\\nDW Documentary gives you knowledge beyond the headlines. Watch high-class documentaries from German broadcasters and international production companies. Meet intriguing people, travel to distant lands, get a look behind the complexities of daily life and build a deeper understanding of current affairs and global events. Subscribe and explore the world around you with DW Documentary.\\n\\nSubscribe to: \\nDW Documentary: https:\/\/www.youtube.com\/channel\/UCW39zufHfsuGgpLviKh297Q?sub_confirmation=1#\\nDW Documental (Spanish): https:\/\/www.youtube.com\/dwdocumental\\nDW Documentary وثائقية دي دبليو: (Arabic): https:\/\/www.youtube.com\/dwdocarabia\\n\\nFor more visit:\\nhttp:\/\/www.dw.com\/en\/tv\/docfilm\/s-3610\\nInstagram:\\nhttps:\/\/www.instagram.com\/dwdocumentary\/\\nFacebook:\\nhttps:\/\/www.facebook.com\/dw.stories\\n\\nDW netiquette policy: https:\/\/p.dw.com\/p\/MF1G\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/_wox36bFDqE\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCvVQY9dTunSzW3unNWRpc_SRmLPQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/_wox36bFDqE\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAdQ1QMgd-MfRvPoNttfvnRkbAGGg\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/_wox36bFDqE\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADI  sense of solidarity help to hold the virus at bay. In Japan, discipline and strict hygiene measures have allowed public life to continue without too much interruption, even in densely populated Tokyo. And in China, where the coronavirus pandemic started, quarantines, lock-down and strict surveillance have contributed to slowing spread. Whether or not these methods prove sustainable in the long run remains to be seen. But they are sending a message of hope that there may be ways out of the coronavirus crisis.\n\n-------------------------------------------------------------------\nDW Documentary gives you knowledge beyond the headlines. Watch high-class documentaries from German broadcasters and international production companies. Meet intriguing people, travel to distant lands, get a look behind the complexities of daily life and build a deeper understanding of current affairs and global events. Subscribe and explore the world around you with DW Documentary.\n\nSubscribe to: \nDW Documentary: "},{"text":"https://www.youtube.com/channel/UCW39...","navigationEndpoint":{"clickTrackingParams":"CJABEM2rARgCIhMItYS6r9ma6QIVkexVCh3cGApUSKGdlLb6u4yF_wE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/channel/UCW39zufHfsuGgpLviKh297Q?sub_confirmation=1#","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/channel/UCW39zufHfsuGgpLviKh297Q?sub_confirmation=1#","nofollow":true}}},{"text":"\nDW Documental (Spanish): "},{"text":"https://www.youtube.com/dwdocumental","navigationEndpoint":{"clickTrackingParams":"CJABEM2rARgCIhMItYS6r9ma6QIVkexVCh3cGApUSKGdlLb6u4yF_wE=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/dwdocumental","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/dwdocumental","nofollow":true}}},{"text":"\nDW Documentary وثائقية دي دبليو: (Arabic): "},{"text":"https://www.youtube.com/dwdocarabia","navigationEndpoint":{"clickTrackingParams":"CJABEM2rARgCIhMItYS6r9ma6QIVkexVCh3cGApUSKGdlLb6u4yF_w
